import React from 'react'
import styled from 'styled-components'

const Regional = () => {
    return (
      <RegionContainer>
          <div className="Blob">

          </div>
      </RegionContainer>
    )
}

export default Regional

const RegionContainer = styled.div`
display : grid;
grid-template-rows: 1fr 2fr;
grid-auto-columns:1fr 1fr;
grid-gap : 10px;`
